import React from "react";
import { useState } from "react";
import { useDispatch } from "react-redux";
import { getNameCountries } from "../actions";

export default function SearchBar (){
    const dispatch = useDispatch();
    const [name,setName] = useState("");


function handleInputChangeName(e){
    e.preventDefault()
    setName(e.target.value)
}

function handleSubmitName(e){
    e.preventDefault()
    dispatch(getNameCountries(name))
}
function handleInputChangeActivity(e){
    e.preventDefault()
    setName(e.target.value)
}

function handleSubmitActivity(e){
    e.preventDefault()
    dispatch(getNameCountries(name))
}
    return (
        <div>
            <div>
                <input
                type="text"
                placeholder= "Buscar..."
                onChange= {(e)=> handleInputChangeName(e)}
                />
                <button type="submit" onClick={(e)=> handleSubmitName(e)} >Buscar</button>
            </div>
            <div>
                <input
                type="text"
                placeholder= "Buscar..."
                onChange= {(e)=> handleInputChangeActivity(e)}
                />
                <button type="submit" onClick={(e)=> handleSubmitActivity(e)} >Buscar</button>
            </div>
        </div>
    )

}
